import React from 'react';
import './App.css';
import {Route, Switch, NavLink} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <head>
        <title>브금 선택</title>
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
      </head>
        <body>
          <nav>
            <label class="logo">BGM On</label>
            <ul>
              <li><NavLink to ="/">Home</NavLink></li>
              <li><NavLink to ="/">강화bgm</NavLink></li>
              <li><NavLink to ="/">매드무비bgm</NavLink></li>
              <li><NavLink to ="/">편안한bgm</NavLink></li>
              <li><NavLink to ="/">애니bgm</NavLink></li>
              <li><NavLink to ="/">피드백</NavLink></li>
            </ul>
          </nav>

        </body>
    </div>
  );
}

export default App;
